        <div >
            <Container>
                <h1>El aroma mágico</h1>
                <br></br>
                <Row className="justify-content-md-center">
                    <img
                        src={fondo}
                        alt="El aroma mágico"
                        width="80%"
                    />
                </Row>
                <br></br>
            </Container>
        </div>)
}

export default Header;
